glsl1.vert:
precision highp float;
uniform highp mat4 cc_matViewProj;
#if USE_LOCAL
  uniform highp mat4 cc_matWorld;
#endif
attribute vec3 a_position;
attribute vec2 a_texCoord;
attribute vec4 a_color;
varying vec4 v_light;
varying vec2 uv0;
#if TWO_COLORED
  attribute vec4 a_color2;
  varying vec4 v_dark;
#endif
vec4 vert () {
  vec4 pos = vec4(a_position, 1);
  #if USE_LOCAL
    pos = cc_matWorld * pos;
  #endif
  pos = cc_matViewProj * pos;
  uv0 = a_texCoord;
  v_light = a_color;
  #if TWO_COLORED
    v_dark = a_color2;
  #endif
  return pos;
}
void main() { gl_Position = vert(); }

glsl1.frag:
precision highp float;
#if USE_ALPHA_TEST
      uniform float alphaThreshold;
#endif
void ALPHA_TEST (in vec4 color) {
  #if USE_ALPHA_TEST
    if (color.a < alphaThreshold) discard;
  #endif
}
void ALPHA_TEST (in float alpha) {
  #if USE_ALPHA_TEST
    if (alpha < alphaThreshold) discard;
  #endif
}
varying vec4 v_light;
#if TWO_COLORED
  varying vec4 v_dark;
#endif
varying vec2 uv0;
uniform sampler2D cc_spriteTexture;
vec4 frag () {
  vec4 o = vec4(1, 1, 1, 1);
  #if TWO_COLORED
    vec4 texColor = vec4(1, 1, 1, 1);
    texColor *= texture2D(cc_spriteTexture, uv0);
     o.a = texColor.a * v_light.a;
    o.rgb = ((texColor.a - 1.0) * v_dark.a + 1.0 - texColor.rgb) * v_dark.rgb + texColor.rgb * v_light.rgb;
  #else
    o *= texture2D(cc_spriteTexture, uv0);
    o *= v_light;
  #endif
  ALPHA_TEST(o);
  return o;
}
void main() { gl_FragColor = frag(); }
